import React from 'react';
import ReactDOM from 'react-dom/client';
import Rectangle from './Rect.js';
import './App.css';


function App() {
  return (
    <div className="App">
        <div
            style={{
                left: '700px',
                height: '100vh',
                width: '50vw',
                position: 'relative'
            }}>
            <button
                style={{
                    marginTop: '160px'
                }}
                onClick={() => alert('Button clicked')}>
                click
            </button>
            <Rectangle
                position="fixed"
                corner={[850, 100]}
                height={150}
                width={500}
                color="#FF0266"
            />
        </div>
    </div>
);
}

export default App;
